import React from "react";
import { Input, Item, Label } from "native-base";
import { Text, View, ScrollView, StyleSheet, ImageBackground, Dimensions,} from "react-native";

const LoginScreen = () => {
  return (
    // Container Start
    <ScrollView
      style={{ flex: 1, backgroundColor: "#ffffff" }}
      showsVerticalScrollIndicator={false}
    >
      {/* Brand View */}
      <ImageBackground
        source={require("../../assets/trakyalogo.jpg")}
        style={{ height: Dimensions.get("window").height / 2.5 }}
      ></ImageBackground>
      {/* Bottom View */}
      <View style={styles.bottomView}>
        <View style={{ padding: 45 }}>
          <Text style={{ color: "#4632A1", fontSize: 34 }}>Welcome</Text>
          <Text style={{ fontSize: 17 }}>
            Don't have an account?
            <Text style={{ color: "red", fontStyle: "italic" }}>
              {" "}
              Register Now
            </Text>
          </Text>
          {/* Form Inputs View */}
          <View style={{ marginTop: 50 }}>
            <Item floatingLabel style={{ borderColor: "4632A1" }}>
              <Label>Email</Label>
              <Input></Input>
            </Item>
          </View>
        </View>
      </View>
    </ScrollView>
    // Container End
  );
};

const styles = StyleSheet.create({
  bottomView: {
    flex: 1.5,
    backgroundColor: "#ffffff",
    bottom: 50,
    borderTopStartRadius: 60,
    borderTopEndRadius: 60,
  },
});

export default LoginScreen;
